import { createAndLoginDummyUser, createUser, validateJWT, getMessages, sendMessage, uploadImage, joinRoom, getUserRooms } from "./api.js";


window.onload = async () => {
    console.log("loaded");

    const result = await validateJWT();
    if (!result.ok) {
        window.location.href = "/";
    }


    await joinRoom(getParameterByName("room"));

    const userChats = await getUserRooms();
    console.log(userChats);

    userChats.forEach(attendedChat => {
        
        const chat = document.createElement("div");
        chat.classList.add("attendedChat");

        if(attendedChat.id == getParameterByName("room")){
            chat.classList.add("activechat");
        }

        chat.innerText = attendedChat.name;
        chat.addEventListener("click", () => {
            window.location.href = `/chat.html?room=${attendedChat.id}`;
        })

        document.getElementById("userchats").appendChild(chat);

    });

    const logoutButton = document.getElementById("logout");
    logoutButton.addEventListener("click", () => {
        window.localStorage.removeItem("jwt");
        window.location.href = "/";
    });

    const messagecontainer = document.getElementById("messagecontainer");

    let loadMore = false;
    let page = 0;

    messagecontainer.addEventListener("scroll", () => {
        //scroll percentage
        const scrollPercentage = messagecontainer.scrollTop / (messagecontainer.scrollHeight - messagecontainer.clientHeight);
        if ((-scrollPercentage) > 0.8) {

            if (!loadMore) {
                loadMore = true;
                page++;
                getMessages(getParameterByName("room"),page).then(messages => {
                    messages.forEach(element => {
                        appendMessage(messagecontainer, element, true);
                    });
                    loadMore = false;
                });
            }

            console.log("load more");
        }
    })


    const joinRoomButton = document.getElementById("joinRoom");

    joinRoomButton.addEventListener("click", (event) => {
        console.log("prompt");
        //get user promt
        event.preventDefault();
        const roomName = prompt("Enter room name");
        if(roomName!=null) {
            window.location.href = `/chat.html?room=${roomName}`;

        }

    })

    //get messages
    const messages = await getMessages(getParameterByName("room"));
    messages.forEach(element => {
        appendMessage(messagecontainer, element, true);
    });

    console.log(messages);


    var socket = io();

    let roomName = "default";

    if(getParameterByName("room")!=null) {
        roomName = getParameterByName("room");
    }


    socket.on(`message.${roomName}`, function (msg) {
        appendMessage(messagecontainer, msg);
        //console.log(msg);
    });

    socket.on(`rickroll.${roomName}`,function(msg) {
        window.location.href = "https://www.youtube.com/watch?v=dQw4w9WgXcQ"
    })

    socket.on(`videochat.${roomName}`,function(msg) {
            window.location.href = "/video.html"
        

    });
    socket.on(`link.${roomName}`, function(msg) {
        window.location.href= msg.link
    });


    socket.on(`clear.${roomName}`,function(msg) {
        messagecontainer.innerHTML = "";
    })

    socket.on(`reload.${roomName}`,function(msg) {
        window.location.reload();
    })

    const messageBox = document.getElementById("chatinput");
    const sendButton = document.getElementById("sendbutton");


    sendButton.addEventListener("click", () => {
        if (messageBox.value.toString().trim().length > 0) {
            sendMessage(messageBox.value.toString(),getParameterByName("room"));
            messageBox.value = "";
        }
    });

    messageBox.addEventListener("keydown", (event) => {
        if (event.key == "Enter" && event.shiftKey) {
            event.preventDefault()
            if (messageBox.value.toString().trim().length > 0) {
                filterBadWords("chatinput")
                sendMessage(messageBox.value.toString(),getParameterByName("room"));
                messageBox.value = "";
            }
        }
    });

    addEventListener('hashchange', (event) => {
        //reload page
        window.location.reload();

    });



    const attatchmentbutton = document.getElementById("attachbtn")

    console.log(attatchmentbutton);

    attatchmentbutton.addEventListener("drop",(e)=>{
        e.preventDefault();

        uploadImage(e.dataTransfer.files[0],getParameterByName("room"));

        console.log(e.dataTransfer.files);
    })

    attatchmentbutton.addEventListener("dragover",(e)=>{
        console.log("drag over")
        e.preventDefault();
    })

}

function appendMessage(messagecontainer, messageOBJ, top = false) {

    const message = document.createElement("div");

    const messageHeader = document.createElement("div");
    messageHeader.classList.add("imessageheader");


    const messageText = document.createElement("div");
    const messageTime = document.createElement("div");

    

    const senderName = document.createElement("div");
    messageTime.innerText = new Date(Date.parse(messageOBJ.createdAt)).toLocaleTimeString();
    messageTime.classList.add("imessagetime")

   

    senderName.classList.add("sender");
    if (messageOBJ.user != null) {
        senderName.innerText = messageOBJ.user.name;
    } else {
        senderName.innerText = "AI";
    }


    messageHeader.appendChild(senderName);
    messageHeader.appendChild(messageTime);

    message.classList.add("imessage");

    messageText.appendChild(messageHeader);

    if (messageOBJ.user == null) {
        messageText.classList.add("from-them");
    } else {

        if (messageOBJ.user.id == window.localStorage.getItem("userID")) {
            messageText.classList.add("from-me");
        } else {
            messageText.classList.add("from-them");

        }

    }



    if (messageOBJ.type == "text") {
        let clean = sanitize(messageOBJ.message);
        console.log(clean)

        messageText.innerHTML += urlify(clean);
        message.appendChild(messageText);
    } else if (messageOBJ.type == "image") {
        const image = document.createElement("img");
        image.classList.add("chatimage");
        image.src = messageOBJ.ressource;
        messageText.append(image);
        message.appendChild(messageText);

    } else if(messageOBJ.type == "iframe") {
        const iframe = document.createElement("iframe");
        iframe.classList.add("chatiframe");
        iframe.src = messageOBJ.ressource;
        messageText.append(iframe);
        message.appendChild(messageText);
    }


    if (!top) { //swap because of reversed flexbox
        messagecontainer.prepend(message);
    } else {
        messagecontainer.append(message);

    }

    console.log(messageOBJ);
}

function urlify(text) {
    var urlRegex = /(https?:\/\/[^\s]+)/g;
    return text.replace(urlRegex, function (url) {
        return '<a href="' + url + '">' + url + '</a>';
    })

}

function sanitize(string) {
    const map = {
        '&': '&amp;',
        '<': '&lt;',
        '>': '&gt;',
        '"': '&quot;',
        "'": '&#x27;'
        //  "/": '&#x2F;',
    };
    const reg = /[&<>"']/ig;
    return string.replace(reg, (match) => (map[match]));
}

